import React from "react";

function Game() {
	return (
		<div className="game">
			<div class="container">
				<div class="row align-items-center">
					<iframe
						src="https://i.simmer.io/@Xenolht/cali-jam"
						height="1200"
						width="1920"
					></iframe>
				</div>
			</div>
		</div>
	);
}

export default Game;
